import React from 'react';
import '../App.css';

const Card = ({card}) => {
    // useEffect( () => {

    // },[]);

    return (
        <div>
            <h1>Bingo</h1>
            {
                card && card.map( animal => {
                    return (
                        <div className="animalCell">
                            <div>{animal.name}</div>
                                <img className="animalImage" src={animal.picture} alt={animal.name}/>
                            </div>
                    )
                })
            }
        </div>
    )
}

export default Card;
